import styles from './LeadsActions.module.css';
const LeadActions = () => {

    return (
        <div className={styles["lead-actions"]}>
            <div>
                <h2>Leads</h2>
            </div>
            <div className={styles.actions}>
                <button className={styles.btn}>Add Lead <div></div></button>
                <div>
                <button className={`${styles["btn"]} ${styles["btn-alt"]}`}>Actions</button>
                </div>
            </div>
        </div>
    )

}

export default LeadActions;
